import React, { useState } from 'react';
import { TextField, Checkbox, FormControlLabel, Button, Box, FormGroup } from '@mui/material';

function PredictPriceForm() {
  const [formData, setFormData] = useState({
    rooms: '',
    bathrooms: '',
    denIncluded: false,
    parkingIncluded: false,
    heatIncluded: false,
    electricityIncluded: false,
    dogsAllowed: false,
    catsAllowed: false,
    address: '',
    postalCode: '',
    dateInFuture: '',
    size: ''
  });

  const handleChange = (event) => {
    const { name, value, type, checked } = event.target;
    setFormData({
      ...formData,
      [name]: type === 'checkbox' ? checked : value
    });
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // You can integrate an API call here to send data to the server
    console.log('Form Data:', formData);
    alert('Submitted with data: ' + JSON.stringify(formData, null, 2));
  };

  const validateField = (name, value) => {
    if (name === 'postalCode') {
      const canadaPostalRegex = /^[A-Za-z]\d[A-Za-z][ -]?\d[A-Za-z]\d$/;
      return canadaPostalRegex.test(value);
    }
    if (name === 'dateInFuture') {
      const inputDate = new Date(value);
      const today = new Date();
      today.setHours(0, 0, 0, 0);
      return inputDate >= today;
    }
    if (name === 'size') {
      return !isNaN(value) && Number(value) > 0;
    }
    return true;
  };

  return (
    <Box component="form" noValidate onSubmit={handleSubmit} sx={{ mt: 1 }}>
      <TextField
        margin="normal"
        required
        fullWidth
        label="Number of Rooms"
        name="rooms"
        type="number"
        value={formData.rooms}
        onChange={handleChange}
      />
      <TextField
        margin="normal"
        required
        fullWidth
        label="Number of Bathrooms"
        name="bathrooms"
        type="number"
        step="0.5"
        value={formData.bathrooms}
        onChange={handleChange}
      />
      <FormGroup>
        <FormControlLabel control={<Checkbox checked={formData.denIncluded} onChange={handleChange} name="denIncluded" />} label="Den Included" />
        <FormControlLabel control={<Checkbox checked={formData.parkingIncluded} onChange={handleChange} name="parkingIncluded" />} label="Parking Included" />
        <FormControlLabel control={<Checkbox checked={formData.heatIncluded} onChange={handleChange} name="heatIncluded" />} label="Heat Included" />
        <FormControlLabel control={<Checkbox checked={formData.electricityIncluded} onChange={handleChange} name="electricityIncluded" />} label="Electricity Included" />
        <FormControlLabel control={<Checkbox checked={formData.dogsAllowed} onChange={handleChange} name="dogsAllowed" />} label="Dogs Allowed" />
        <FormControlLabel control={<Checkbox checked={formData.catsAllowed} onChange={handleChange} name="catsAllowed" />} label="Cats Allowed" />
      </FormGroup>
      <TextField
        margin="normal"
        required
        fullWidth
        label="Address"
        name="address"
        value={formData.address}
        onChange={handleChange}
        inputProps={{ maxLength: 100 }}
      />
      <TextField
        margin="normal"
        required
        fullWidth
        label="Postal Code"
        name="postalCode"
        value={formData.postalCode}
        onChange={handleChange}
        error={!validateField('postalCode', formData.postalCode)}
        helperText={!validateField('postalCode', formData.postalCode) ? "Invalid Canadian postal code" : ""}
      />
      <TextField
        margin="normal"
        required
        fullWidth
        label="Date in Future"
        name="dateInFuture"
        type="date"
        InputLabelProps={{ shrink: true }}
        value={formData.dateInFuture}
        onChange={handleChange}
        error={!validateField('dateInFuture', formData.dateInFuture)}
        helperText={!validateField('dateInFuture', formData.dateInFuture) ? "Date must be in the future" : ""}
      />
      <TextField
        margin="normal"
        required
        fullWidth
        label="Size in Square Feet"
        name="size"
        type="number"
        value={formData.size}
        onChange={handleChange}
        error={!validateField('size', formData.size)}
        helperText={!validateField('size', formData.size) ? "Size must be a positive number" : ""}
      />
      <Button
        type="submit"
        fullWidth
        variant="contained"
        sx={{ mt: 3, mb: 2 }}
      >
        Predict Price
      </Button>
    </Box>
  );
}

export default PredictPriceForm;
